# ====================== TASK 4 ======================# POLISH NOTATIONs = input()if '(' in s:    # Qavs ichi    in1 = s.index('(')    in2 = s.index(')')    qavs_ichi = s[in1 + 1:in2].split()    res = eval(f"{qavs_ichi[1]} {qavs_ichi[0]} {qavs_ichi[2]}")    # Qavs tashqarisi    qavs_tashqarisi = s[:in1] + s[in2 + 1:]    qavs_tashqarisi = qavs_tashqarisi.split()    print(eval(f"{res} {qavs_tashqarisi[0]} {qavs_tashqarisi[1]}"))else:    s = s.split()    print(eval(f"{s[1]} {s[0]} {s[2]}"))